import React from "react";
import Card from "./elements/CardFunction";

class CardList extends React.Component {
  state = { data: [] };

  componentDidMount() {
    fetch("http://127.0.0.1:5000/item/apple")
      .then(res => res.json())
      .then(db => {
        this.setState({
          data: Object.keys(db).map(function(key) {
            return [Number(key), obj(key)];
          })
        });
      })
      .catch(console.log);
  }

  renderCards = () => {
    this.state.data.map(item => {
      return <div>{item} </div>;
      // <Card data={item} />;
    });
  };

  render() {
    return <div className="ui container">{this.state.data[0]}</div>;
  }
}

export default CardList;
